import React, { useEffect } from "react";
import { ListResult } from "../Components/ListResult"

export const SearchingPage = ({ history, results }) => {
	console.log({ history })

	useEffect(() => {
		window.scrollTo(0, 0)
	}, [])

	return <>{results.map(result =>
		<ListResult
			key={result.url}
			url={result.url}
			title={result.title}
			snippet={result.snippet}
		/>
	)}</>
}
